      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE col0 NOT BETWEEN NULL AND NULL AND NOT ( + col0 / + CAST ( - - ( + + col1 ) AS INTEGER ) - - col1 * + col2 ) IS NOT NULL;
  - name: tab0

outputs:
  - name: q12635.out
    data: |
